                >
                  <Input
                    type="number"
                    size="xs"
                    value={marginValue}
                    w={45}
                    readOnly
                    style={{ borderRadius: "20px" }}
                  />
                  <Slider
                    value={marginValue}
                    onChange={handleMarginChange}
                    min={0}
                    max={100}
                    w={100}
                    label={null}
                  />
                  <IconPlus
                    onClick={handleMarginIncrement}
                    style={{
                      border: "1px solid #000",
                      borderRadius: "50%",
                      cursor: "pointer",
                    }}
                  />
                </Flex>
              </Stack>
            </Accordion.Panel>
          </Accordion.Item>
        </Accordion>
      </Box>
    </ScrollArea>
  );
};

export default CategoryCustomize;
